import { useState } from "react";
import { Link, useHistory, useParams } from "react-router-dom";
import { useEffect } from "react/cjs/react.development";
import airlineService from "../services/airline.service";

const RegistrationPage = () => {
    const[email, setEmail] = useState('');
    const[userName, setUserName] = useState('');
    const[phone, setPhone] = useState('');
    const[password, setPassword] = useState('');
    const[confirmPassword, setConfirmPassword] = useState('');
    const[securityQusetion, setSecurityQuestion] = useState('');
    const[answer, setAnswer] = useState('');
    const[userType , setUserType] = useState('');
    const history = useHistory();
    const {id} = useParams();



    const saveUser = (e) => {
        e.preventDefault();

        const user = {email , userName , phone , password , securityQusetion , answer};

            //create
            if(password === confirmPassword){
            airlineService.createUser(user)
            .then(response => {
                console.log("User added successfully", response.data);
              history.push("/login");
            })
            .catch(error => {
                console.log('something went wrong', error);
            })
            }
            else{
                document.getElementById("notmatch").innerText="PASSWORD DID NOT MATCH"
            }
    }


    return(
        <div className="container">
            <h3>Register</h3>
            <hr/>
            <form>
            <div className="form-group">
                    <input 
                        type="email" 
                        className="form-control col-4"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="ENTER EMAIL"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="username"
                        value={userName}
                        onChange={(e) => setUserName(e.target.value)}
                        placeholder="ENTER USER NAME"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="phone"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                        placeholder="ENTER MOBILE NUMBER"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="password" 
                        className="form-control col-4"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="ENTER PASSWORD"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="password" 
                        className="form-control col-4"
                        id="confirmPassword"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        placeholder="CONFIRM PASSWORD"
                        required
                    />
                    <div>
                        <p id="notmatch"></p>
                    </div>

                </div>

                <div>
                    <select class="form-control "  value={securityQusetion} 
                    onChange={(e) => setSecurityQuestion(e.target.value)}>   
                            <option value="" disabled selected>Select Your Security Question</option>
                            <option value="school">What is your School name?</option>
                            <option value="pet">What is your pet name?</option>
                            <option value="movie">Which is your favourite movie?</option>
                            <option value="color">Which is your favourite color?</option>


                     </select>

                </div> 

                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="answer"
                        value={answer}
                        onChange={(e) => setAnswer(e.target.value)}
                        placeholder="ENTER SECURITY ANSWER"
                        required
                    />
                </div>
                <div>
                    <select class="form-control "  value={userType} 
                    onChange={(e) => setUserType(e.target.value)}>

                            <option value="" disabled selected>REGISTERING AS ADMIN OR USER</option>
                            <option value="admin">ADMIN</option>
                            <option value="user">USER</option>

                     </select>

                </div> 

                <div >
                    <button onClick={(e)=>saveUser(e)} className="btn btn-primary">
                        Register</button>
                </div>
            </form>
            <hr/>
        </div>
    )
}

export default RegistrationPage;
